//다크모드를 위한 준비
const darkTheme = {
  textColor:"whitesmoke",
  backgroundColor:"#111"
}
//라이트모드를 위한 준비
const lightTheme = {
  textColor:"#111",
  backgroundColor:"whitesmoke"
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  //<React.StrictMode>
    //모드를 위한 준비
    <ThemeProvider theme={darkTheme}>
      <App />
    </ThemeProvider>

  //</React.StrictMode>
);
